import * as React from 'react';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import CssBaseline from '@mui/material/CssBaseline';
import { useState } from "react";


const roundedButton = {
  borderRadius: 55,
  minWidth: '128px'
}
const bottonContainer = {
  width:180,
  justifyContent: 'center',
  alignItems: 'center',
}

export default function BuySellButtons() {
  const [active, setActive] = useState("");
 
  const handleClick = (event: { target: { id: React.SetStateAction<string>; }; }) => {
    setActive(event.target.id);
    
  }

  const roundedButton = {
    borderRadius: 55,
    minWidth: '128px',
    color: active === "buy" ? 'white': '',
  }
const [enabled, setEnabled] = useState(0);

  return (
        <ButtonGroup sx={bottonContainer} variant="contained" aria-label="outlined primary button group">
            <Button 
              sx={ roundedButton } 
              onClick={handleClick}
              
              id={"buy"}
            >
              Buy
            </Button>

            <Button sx={ roundedButton } 
              onClick={() => handleClick}
              className={active === "sell" ? "active" : undefined}
              id={"sell"}
            >
              Sell
            </Button>
        </ButtonGroup>
  );
}
